import { Container } from "@mui/material";
import React from "react";
import { Home } from "@mui/icons-material";

function Leftbar() {
  return (
    <Container>
      <div>
        <Home />
        <Typography>Homepage</Typography>
      </div>
    </Container>
  );
}

export default Leftbar;
